import React, {Component} from 'react';
import Pengunjung from './componets/module/dashboard/Pengunjung';
import Pengguna from './componets/module/dashboard/Pengguna';
import RouterApp from "./componets/other/RouterApp";

// import Footer from './componets/layout/Footer';
// import Header from './componets/layout/Header';
// import Menu from './componets/layout/Menu';




class App extends Component{
  constructor(props){
    super(props);
  }

  render(){
    // console.log(routerList)
    return(
      <div>
        <Router>
            <Switch>
                <AppRoute path='/' layout={Layout} exact title="Dashboard Pengunjung" component={Pengunjung} />
                <AppRoute path='/pengunjung' layout={Layout} component={Pengunjung} />
                <AppRoute path='/pengguna' layout={Layout} component={Pengguna} />
            </Switch>
        </Router>
      </div> 
    );
  }
}

export default App;
